package rle

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
)

func Test_Decompress(t *testing.T) {
	t.Skip("not implemented")

	testCases := []struct {
		name     string
		input    string
		expected string
	}{
		{
			name:     "черный_квадрат",
			input:    "001c840000000000000000f0bc0f840000000000000000",
			expected: "",
		},
		{
			name:     "синий_квадрат",
			input:    "c02cd30284d302d302d302d302f0bc0f84d302d302d302d302",
			expected: "",
		},
		{
			name:     "синий_квадрат_с_белым_шариком",
			input:    "",
			expected: "",
		},
		{
			name:     "нижняя_часть_кнопки_ОК",
			input:    "001c840000000000000000f0000ac0304529c030dbdef04802c028b29409c027610809fdc02659ce0a811ce7c0258a52f02901d0879ef787080000000000800f0c0000000000c018404e06000000000000000300",
			expected: "",
		},
	}

	for _, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			output := make([]uint8, len(tc.expected)/2)

			input, err := hex.DecodeString(tc.input)
			require.NoError(t, err)

			success := Decompress(input, output, 64*2)
			require.True(t, success)

			actual := hex.EncodeToString(output)

			require.Equal(t, tc.expected, actual)
		})
	}
}
